import React, { useState } from 'react';

function BurgerMenu() {
  const [showMenu, setShowMenu] = useState(false);

  const toggleMenu = () => {
    setShowMenu(!showMenu);
  };

  return (
    <div>
      <button onClick={toggleMenu}>Toggle Menu</button>
      {showMenu && (
        <div>
          {/* Menu items here */}
        </div>
      )}
    </div>
  );
}

export default BurgerMenu;
